def main(gas, cost):
        if sum(gas) < sum(cost):
            return -1

        n, start, total_tank, current_tank = len(gas), 0, 0, 0
        
        for i in range(n):
            total_tank += gas[i] - cost[i]
            current_tank += gas[i] - cost[i]
            
            if current_tank < 0:
                # set the new start point
                start = i + 1
                current_tank = 0
        
        return start if total_tank >= 0 else -1

